(1525530876662099968, 'Browsing sekolah international dengan #internet malam Telkom indihome sangat lancar gaiss, tugas sekolah lancar tidur pun pulas \n#telkomjabar\n#rewardchallengetr3 \n#indihome https://t.co/cVmVBVKSx6', 'browsing sekolah international malam telekomunikasi indihome lancar gaiss tugas sekolah lancar tidur pulas', 'tielumphd', '2022-05-14 17:37:58', 'positif'),
(1525538580159865088, '@vidio Saya nontonya di TV indihome. Gimana ngasih linknya. Hadeh kecewa', 'nontonya tv indihome linknya hadeh kecewa', 'BagusOfficial23', '2022-05-14 18:08:35', ''),
(1525540026666589952, '@lahodette @IndiHome Coba langsung DM @IndiHomeCare aja, kemaren juga gua sempet ga stabil, langsung dibenerin kok', 'coba dm ga stabil dibenerin', 'Muhamma10412359', '2022-05-14 18:14:20', 'positif'),
(1525653774412694016, 'setelah baca komentar orang-orang tentang ribetnya pindah alamat  \"INDIHOME\" ke rumah lain, mereka bilang ribet mending putus aja dsb. Awalnya ga percaya trus nyoba sendiri eh ternyata bener wkwkwkwkwkwkwkwkwkwkw \n((user lama dari 2015-2016)) dari zaman pake telpon rumah.', 'baca komentar orangorang ribetnya pindah alamat indihome rumah bilang ribet putus ga percaya trus nyoba eh benar wkwkwkwkwkwkwkwkwkwkw user zaman pakai telpon rumah', 'tetehbiaaa', '2022-05-15 01:46:19', 'positif'),
(1525699841224888064, '@SeputarTetangga Ini bisa diatur jadi gakeliatan nama wifinya kok. Jadi yang bisa login itu pake SSID. Jadi yang login yang nyambung. Ayo panggil abang indihome nya', 'atur gakeliatan nama wifinya login pakai ssid login nyambung ayo panggil abang indihome nya', 'femmeufatale', '2022-05-15 04:49:22', 'positif'),
(1525702663962210048, 'Itâs Final! Indonesia sebagai juara bertahan telah melaju ke babak Final. Ayo dukung Tim Indonesia bertanding melawan India????\nSaksikan pertandingan Final Total Energies BWF Thomas Cup 2022 pake paket streaming di UseeTV GO nya IndiHome\n#BWFThomasUberCup #ThomasCup2022 #UseeTVGO https://t.co/VhgQNjHjb6', 'its final indonesia juara tahan laju babak final ayo dukung tim indonesia tanding lawan indiasaksikan tanding final total energies bwf thomas cup pakai paket streaming useetv go nya indihome', 'pralitaep', '2022-05-15 05:00:35', 'positif'),
(1525707042249249024, '@cha_junijunior gue pake indihome aman nih Kak, misal ganguan indihome nya colek aja ke @IndiHomeCare balesnya cepet ko', 'pakai indihome aman kak ganguan indihome nya colek balesnya cepat ko', 'Duyungbiru_', '2022-05-15 05:17:59', 'positif'),
(1525711104663399936, 'Update aplikasi pake jaringan IndiHome emang lancar banget. ???? https://t.co/OGwXjR64HZ', 'update aplikasi pakai jaring indihome lancar banget', 'ahmadb_15', '2022-05-15 05:34:08', 'positif'),
(1525718289145803008, 'terima kasih indihome, saya sangat sangat sangaaaat terbantu dengan pelayanannya, saya sudah pake 1 tahunan, dan setiap kendala tertangani dengan cepat dan tuntas, udah 3-4x butuh bantuan gercepp banget @IndiHomeCare #pastiberes', 'terima kasih indihome sangaaaat bantu layan pakai tahun kendala tangan cepat tuntas x butuh bantu gercepp banget', 'fujoshiland', '2022-05-15 06:02:41', 'positif'),
(1525728591899554048, 'anj indihome gabisa, pake kuota jg leletnya kebangetan', 'anj indihome gabisa pakai kuota lelet banget', 'syugarboo', '2022-05-15 06:43:37', '');
